# 数据库表：aq_access 结构信息
DROP TABLE IF EXISTS `aq_access`;
CREATE TABLE `aq_access` (
  `role_id` smallint(6) unsigned NOT NULL,
  `node_id` smallint(6) unsigned NOT NULL,
  `level` tinyint(1) NOT NULL,
  `pid` smallint(6) DEFAULT NULL,
  `module` varchar(50) DEFAULT NULL,
  KEY `groupId` (`role_id`),
  KEY `nodeId` (`node_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='权限分配表' ;

# 数据库表：aq_admin 结构信息
DROP TABLE IF EXISTS `aq_admin`;
CREATE TABLE `aq_admin` (
  `aid` int(11) NOT NULL AUTO_INCREMENT,
  `nickname` varchar(20) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL COMMENT '登录账号',
  `pwd` char(32) DEFAULT NULL COMMENT '登录密码',
  `status` int(11) DEFAULT '1' COMMENT '账号状态',
  `remark` varchar(255) DEFAULT '' COMMENT '备注信息',
  `find_code` char(5) DEFAULT NULL COMMENT '找回账号验证码',
  `time` int(10) DEFAULT NULL COMMENT '开通时间',
  PRIMARY KEY (`aid`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='网站后台管理员表' ;

# 数据库表：aq_count 结构信息
DROP TABLE IF EXISTS `aq_count`;
CREATE TABLE `aq_count` (
  `id` int(2) NOT NULL AUTO_INCREMENT,
  `a1` int(1) NOT NULL,
  `a2` int(1) NOT NULL,
  `a3` int(1) NOT NULL,
  `a4` int(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='赛率' ;

# 数据库表：aq_member 结构信息
DROP TABLE IF EXISTS `aq_member`;
CREATE TABLE `aq_member` (
  `id` int(10) NOT NULL COMMENT 'id自增',
  `school_ID` varchar(50) NOT NULL COMMENT '学号',
  `name` varchar(15) NOT NULL COMMENT '姓名',
  `college` varchar(100) NOT NULL COMMENT '学院',
  `specialty` varchar(100) NOT NULL COMMENT '专业',
  `grade` varchar(50) NOT NULL COMMENT '班级',
  `password` varchar(100) NOT NULL COMMENT '密码',
  `ti_id` int(2) NOT NULL,
  `answer` varchar(1000) NOT NULL,
  `isdone` int(1) NOT NULL DEFAULT '0',
  `fraction` int(4) NOT NULL COMMENT '分数',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='学生管理' ;

# 数据库表：aq_node 结构信息
DROP TABLE IF EXISTS `aq_node`;
CREATE TABLE `aq_node` (
  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  `title` varchar(50) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '0',
  `remark` varchar(255) DEFAULT NULL,
  `sort` smallint(6) unsigned DEFAULT NULL,
  `pid` smallint(6) unsigned NOT NULL,
  `level` tinyint(1) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `level` (`level`),
  KEY `pid` (`pid`),
  KEY `status` (`status`),
  KEY `name` (`name`)
) ENGINE=MyISAM AUTO_INCREMENT=45 DEFAULT CHARSET=utf8 COMMENT='权限节点表' ;

# 数据库表：aq_role 结构信息
DROP TABLE IF EXISTS `aq_role`;
CREATE TABLE `aq_role` (
  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  `pid` smallint(6) DEFAULT NULL,
  `status` tinyint(1) unsigned DEFAULT NULL,
  `remark` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `pid` (`pid`),
  KEY `status` (`status`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='权限角色表' ;

# 数据库表：aq_role_user 结构信息
DROP TABLE IF EXISTS `aq_role_user`;
CREATE TABLE `aq_role_user` (
  `role_id` mediumint(9) unsigned DEFAULT NULL,
  `user_id` char(32) DEFAULT NULL,
  KEY `group_id` (`role_id`),
  KEY `user_id` (`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='用户角色表' ;

# 数据库表：aq_subject 结构信息
DROP TABLE IF EXISTS `aq_subject`;
CREATE TABLE `aq_subject` (
  `id` int(5) NOT NULL,
  `timu` varchar(250) NOT NULL,
  `options1` varchar(182) NOT NULL,
  `options2` varchar(192) NOT NULL,
  `options3` varchar(246) NOT NULL,
  `options4` varchar(155) NOT NULL,
  `answer` varchar(100) NOT NULL,
  `degree` varchar(4) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='题库' ;

# 数据库表：aq_ti 结构信息
DROP TABLE IF EXISTS `aq_ti`;
CREATE TABLE `aq_ti` (
  `id` int(2) NOT NULL AUTO_INCREMENT,
  `ti` varchar(1000) NOT NULL,
  `daan` varchar(1000) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 ;



