INSERT INTO `aq_subject` VALUES ('1','同学之间发生小摩擦时，下列处理方法正确的是','原谅同学或报告老师，让老师处理','据情节给予报复','记恨在心，事后叫校外人员教训对方','叫家长到学校来教训对方','1','2');
INSERT INTO `aq_subject` VALUES ('2','在学校，要学会与同学友好相处，创造一个轻松愉快的学习氛围，以下哪一项是正确的','同学之间要有和解意识，做错了事主动道歉。','“人善被人欺”，即使我错了也要力争到底。','搞好学习就够了，同学之间少来往','同学关系无所谓','1','2');
INSERT INTO `aq_subject` VALUES ('3','着火时，当楼梯已被烧断，通道已被堵死，下列方法不妥当的是','立即从楼上往下跳','比较低的楼层，可以利用结实绳索(也可以床单，窗帘布等物撕成条拧结成绳)拴好绳索，沿绳爬下','若被困于二楼，也可以先向外扔一些被褥坐垫子，然后攀着窗口或阳台往下跳','可以转移到其他比较安全的房间，窗边或阳台上，耐心等待消防人员援救','1','2');
INSERT INTO `aq_subject` VALUES ('4','网络为我们提供了广阔空间的同时也对网民提出了更高的道德要求，但是虚拟社会不象现实社会一样有监督、有制裁，对此，你的看法是：','自觉遵守网络文明公约，做一个文明的网民','反正谁也不知道我是谁，搞个恶作剧也无所谓','网络正好为我提供了为所欲为的平台','与己无关，漠不关心','1','2');
INSERT INTO `aq_subject` VALUES ('5','应选择在何场所学习游泳：','游泳池','小河','大江','海滩','1','2');
INSERT INTO `aq_subject` VALUES ('6','在公园、游乐场所划船时需要穿救生衣吗：','需要','不需要','无所谓','有就穿，没有就算了','1','2');
INSERT INTO `aq_subject` VALUES ('7','火场逃生的原则是:','安全撤离,救助结合','抢救国家财产为上','带上钱财再走','只顾自己不顾他人','1','2');
INSERT INTO `aq_subject` VALUES ('8','在火灾或者日常生活中，如被烧、烫伤最有效的应急方法是（ ）.','用冷水浸泡或冰块冷敷等紧急散热措施','立即包扎','就近送医院','打120','1','2');
INSERT INTO `aq_subject` VALUES ('9','犯罪分子欺骗学生的方式下列哪个选项不是？ （ ）','正规公司的招聘','假装销“黄”，乘机敲诈','故意撞人，勒索钱财','骗取信任，掩盖作案真相','1','2');
INSERT INTO `aq_subject` VALUES ('10','汇东、黄岭、营盘校区报警求助电话号码分别是','汇东5506119 黄岭3930110 营盘2113119','汇东3930110 黄岭5506119 营盘2113119','汇东2113119 黄岭3930110 营盘5506119','汇东5506119 黄岭2113119 营盘3930110','1','2');
INSERT INTO `aq_subject` VALUES ('11','违反治安管理行为最基本的特征是（ ）。','具有一定的社会危害性','具有违法性','尚不够刑事处罚','应受治安管理处罚','1','2');
INSERT INTO `aq_subject` VALUES ('12','ABC干粉扑救固体可燃物的火灾时，应对准（ ）喷射？','燃烧最猛烈处，并上下、左右扫射','随便喷射就行','朝火焰根部喷射','朝火苗喷射','1','2');
INSERT INTO `aq_subject` VALUES ('13','传销的危害是','扰乱市场经济秩序，侵害各个法律客体；','不会给参与者及家庭造成危害；','从不引发刑事犯罪，也不会给社会带来危害；','只要自己想得开，不会给社会道德诚信体系造成巨大破坏。','1','2');
INSERT INTO `aq_subject` VALUES ('14','毒品具有四个基本特征,请问以下哪一项不是毒品的特征','麻醉性','依耐性','危害性','非法性','1','2');
INSERT INTO `aq_subject` VALUES ('15','如果雷暴发生时，您正在有防雷设施的建筑物附近，下列做法不正确的是','继续在建筑物朝天面上活动。','不要接触天线、水管、铁丝网、金属门窗、建筑物外墙，远离带电设备','紧闭门窗，防止危险的侧击雷和球形闪电侵入。','最好关闭电脑、彩电、音响、影碟机等弱电设备。','1','2');
INSERT INTO `aq_subject` VALUES ('16','下列震后自救,做法错误的是','设法脱离险境,若找不到脱离险境的通道,应用力大声哭喊、呼救,直到救援人员赶到','保持呼吸畅通,挪开头部、胸部的杂物','若救援人员未到,尽量寻找食品和饮用水,必要时自己的尿液也能起到解渴作用','扩大和稳定生存空间,用砖块木棍等支撑残垣断壁,以防余震后,环境进一步恶化','1','2');
INSERT INTO `aq_subject` VALUES ('17','大学生发生纠纷的原因各异，主要表现为七种方式，如：不拘小节、骂人、嫉妒他人：以下选项中，哪项全部属于？','开玩笑过分、猜疑、不谦虚、狂妄自大、目中无人、极端利己、不容他人','开玩笑过分、猜疑、不谦虚、狂妄自大、宽容','自信、狂妄自大、目中无人、极端利己、不容他人','猜疑、不谦虚、认真、狂妄自大、目中无人','1','2');
INSERT INTO `aq_subject` VALUES ('18','挪用、破坏消防器材，将处以怎样的制裁？','拘留、罚款、警告处分','开除学籍','留校察看','不做任何处罚','1','2');
INSERT INTO `aq_subject` VALUES ('19','为避免抢劫应注意哪些？','不炫耀随身贵重物品；','独自出游；','走偏僻阴暗的地方；','滞留校外；','1','2');
INSERT INTO `aq_subject` VALUES ('20','在大学寝室内不允许使用大功率的电器，下列哪个选项全部属于大功率的电器。','电热管、电暖瓶、电热毯','电饭煲、电风扇、台灯','电暖瓶、热的快、电脑','电热毯、电磁炉、饮水机','1','2');
INSERT INTO `aq_subject` VALUES ('21','机动车从匝道驶入高速公路，应当先在加速车道内提速，并开启（ ），在不妨碍已在高速公路内的机动车正常行驶的情况下驶入车道。','左转向灯','右转向灯','危险报警闪光灯','前照灯','1','2');
INSERT INTO `aq_subject` VALUES ('22','什么是隔离法灭火？','隔离可燃物灭火','隔开氧气灭火','隔离人群灭火','隔离传播途径灭火','1','2');
INSERT INTO `aq_subject` VALUES ('23','校门口流动小摊贩卖的食品，没有商标和生产厂家，对于这些食品，正确的看法是什么？','这些小食品，味道鲜美，价格便宜，可以购买','这些小食品的卫生缺乏保障，坚决不要买来吃','偶尔吃几次，不会有什么问题','便宜就好,吃了再说','2','2');
INSERT INTO `aq_subject` VALUES ('24','进入别人房间首先要敲门，得到允许方可进入，敲门一般要敲（ ）。','1下','3下','5下','无所谓','2','2');
INSERT INTO `aq_subject` VALUES ('25','看到未成年人在江河里游泳，应：','看看就走','劝阻','一起游泳','无所谓','2','2');
INSERT INTO `aq_subject` VALUES ('26','当你发现受骗后，应该怎么办：','自认倒霉','报告派出所','无所谓','自行处理，设法找到骗子','2','2');
INSERT INTO `aq_subject` VALUES ('27','公交车厢内壁上挂有一个红色的好像小铁锤的东西，你知道它的用途吗：','修车工具','紧急出口的使用工具','装饰用品','发动机的一个构件','2','2');
INSERT INTO `aq_subject` VALUES ('28','故意毁损学校的消防设施设备的行为是','违纪行为','违法行为','犯罪行为','不道德行为','2','2');
INSERT INTO `aq_subject` VALUES ('29','火灾中引起人员大量伤亡的主要原因是','相互挤压致死','吸入烟气窒息死亡','被火烧死','砸伤','2','2');
INSERT INTO `aq_subject` VALUES ('30','当遇到火灾时，要迅速向（ ）逃生。','着火相反的方向','安全出口的方向','人员多的方向','人少的地方','2','2');
INSERT INTO `aq_subject` VALUES ('31','检查燃气用具是否漏气时，通常采用( )来寻找漏气点。','划火柴','肥皂水','闻气味','找厨房','2','2');
INSERT INTO `aq_subject` VALUES ('32','如果因电器引起火灾，在许可的情况下，你必须首先?','找寻适合的灭火器扑救','将有开关的电源关掉','大声呼叫','打119','2','2');
INSERT INTO `aq_subject` VALUES ('33','当机动车停在机动车道上时，你应当怎样上下车？','从机动车左侧上下车','从机动车右侧上下车','只要不妨碍其他车辆和行人通行，左右侧上下车都可以','看他在那边','2','2');
INSERT INTO `aq_subject` VALUES ('34','没有划分机动车道、非机动车道和人行道的道路，机动车','在道路两边通行','在道路中间通行','实行分道通行','可随意通行','2','2');
INSERT INTO `aq_subject` VALUES ('35','怎样处理运动中的皮肤损伤','擦伤后马上上药','先用药水清洗伤口然后在上药','直接用冷水冲','用温水热敷','2','2');
INSERT INTO `aq_subject` VALUES ('36','赌博是一种丑恶的社会现象，是利用赌具，以钱财作赌注，以占有他人利益为目的的违法犯罪行为。大学生一旦参与赌博，其危害将是多方面的。下列选项中不属于其危害的是','荒废学业','赌博怡情','破坏同学关系，影响正常秩序','容易走上违法犯罪之路','2','2');
INSERT INTO `aq_subject` VALUES ('37','道路与铁路平面交叉道口有两个红灯交替闪烁或者一个红灯亮时，（ ）。','车辆在确保安全的情况下可以通行','禁止车辆、行人通行','禁止车辆通行，但行人可以通行','禁止行人通行，但车辆可以通行','2','2');
INSERT INTO `aq_subject` VALUES ('38','若发生食物中毒,以下措施中不正确的是','立即向急救中心120呼救,送中毒者到医院进行洗胃、导泻、灌肠','用人工刺激法,如用手,利物刺激中毒者的咽弓及咽后壁,引起呕吐','妥善处理可疑食物','及时向上级及相关部门报告,特别是向所在地食品监督机构报告','2','2');
INSERT INTO `aq_subject` VALUES ('39','在勤工俭学中下列下列哪些情况是错误的？','把勤工俭学与经商的界限区别开；','女大学生陪酒陪舞；','遵纪守法，凭诚实劳动获得报酬；','有组织守法的开展活动；','2','2');
INSERT INTO `aq_subject` VALUES ('40','夜间行车中，如果灯光照射( )，有可能是车辆前方出现急转弯或大坑。','由远及近','离开路面','距离不变','由高变低','2','2');
INSERT INTO `aq_subject` VALUES ('41','校外租房一旦发生案件和事故下列处理方式哪个不正确？','利用“110”或急救电话求救；','胆小怕事，自己隐瞒；','保护现场不被破坏，及时向学校有关部门汇报；','沉着冷静，牢记关键特征，向警方提供有价值的证据。','2','2');
INSERT INTO `aq_subject` VALUES ('42','关节损伤扭伤、脱臼、骨折的伤员（ ）。','允许改变损伤时瞬间的位置','应避免活动','尽量自行复位','可适当调整损伤时的姿势','2','2');
INSERT INTO `aq_subject` VALUES ('43','以下选项中不属于电器设备引起火灾的原因是','短路','用电量小','超负荷','电线老化','2','2');
INSERT INTO `aq_subject` VALUES ('44','以下选项中不是造成火灾的条件。','可燃物','风','助燃剂','火源','2','2');
INSERT INTO `aq_subject` VALUES ('45','经常发怒易治病，以下选项中,对付发怒哪项是错误的?','使自己置身于外,冷静想一想','用暴力手段解决','用语言将愤怒说出,理智地看待事情','”退一步海阔天空”','2','2');
INSERT INTO `aq_subject` VALUES ('46','当从直升机上扔下绳索时，我们应当等绳子落到地面时再抓住它。这样做主要是为了','防止飞机为稳定而发生安全事故','防止触电','减少体能消耗','以上都不对','2','2');
INSERT INTO `aq_subject` VALUES ('47','在海边游泳时，如果遇上巨浪应当','迎向它','潜入水中','立即撤离','以上都不对','2','2');
INSERT INTO `aq_subject` VALUES ('48','遇到斗殴，首先应想到如何防止，要防止就得先了解情况，常见的斗殴有哪些？应当采取的方法下列哪项对应错误？','防突发性斗殴-说服术','防报复性-反报复；','防演变性斗殴-防止演变到极点','防群众性-及时上报。','2','2');
