INSERT INTO `aq_subject` VALUES ('174','餐饮业卫生量化分级管理A、B、C、D级的含义是?','A、B、C、D级代表餐馆卫生等级，A级代表卫生优秀，B级代表卫生规范，C级代表卫生基本合格，D级代表存在一定卫生问题，需要限期改进。','A、B、C、D级代表餐馆环境，A级代表就餐环境高档，B级代表就餐环境较好，C级代表就餐环境一般，D级代表就餐环境不好。','A、B、C、D级代表餐馆消费水平，A级代表餐馆消费水平很高，B级代表餐馆消费水平较高，C级代表餐馆消费水平一般，D级代表餐馆消费水平低。','A、B、C、D级代表餐馆规模，A级代表餐馆规模很大，B级代表餐馆规模较大，C级代表餐馆规模一般，D级代表餐馆较小。','1','2');
