INSERT INTO `aq_subject` VALUES ('299','当你身处同伴当中的时候，很容易因为某一个人的大胆提议（比如翻墙、在马路上进行自行车比赛等）而将自己陷入危险的境地，当你面对这样危险的提议的时候，你该怎么办呢？','为了避免被同伴孤立，也要硬着头皮参与','劝阻同伴，同时大胆地表达“如果你真是我的朋友，就不要强迫我”','可以参加，但是要注意安全','友谊第一，勇敢地参与','2','2');
