INSERT INTO `aq_subject` VALUES ('301','关于在冰箱内储存食物，以下不正确的说法是？','冰箱冷藏的温度在0-5°，这温度对大肠杆菌、伤寒杆菌等没有明显的抑制作用，它们的大量繁殖会造成食品的变质','食品只要放进电冰箱冷藏室里，就可以把细菌全都冻死，可以长期保存，随吃随取','熟食在冰箱冷藏的时间不宜太长，要保持冰箱内清洁卫生，生、熟分开','大多数细菌一般在煮沸时可以被杀灭，可是却能耐受低温','2','2');
