INSERT INTO `aq_subject` VALUES ('522','下列食品中，哪些属禁止生产经营的?','营养成分不符合食品安全标准的专供婴幼儿和其他特定人群的主辅食品','超过保质期的食品','无标签的预包装食品','以上都是','4','2');
INSERT INTO `aq_subject` VALUES ('523','食品经营者销售的预包装食品的包装上，应当有标签，以下关于标签表述不正确的是?','标签不得含有虚假、夸大的内容','标签不得涉及疾病预防、治疗功能','标签应当清楚、明显，容易辨识','标签应该突出表明功效','4','2');
INSERT INTO `aq_subject` VALUES ('524','有人触电后，下面哪种应急措施是正确的','就地使用铁器或潮湿的棍棒拨开触电者身上的电线或电器用具','用手拉触电者的身体','站在木板上或穿上不带钉子的胶底鞋，用两只手拉触电者的干燥衣服','赶快拉掉电源开关或拔掉电源插头','4','2');
INSERT INTO `aq_subject` VALUES ('525','高速公路限速标志标明的最高时速不得超过（ ）公里，最低多少公里？','最高时速不得超过110公里，最低50公里','最高时速不得超过110公里，最低60公里','最高时速不得超过120公里，最低50公里','最高时速不得超过120公里，最低60公里','4','2');
INSERT INTO `aq_subject` VALUES ('526','一般来说，水果的表面会含有一些农药残留物质，以下哪种方法不能有效地去除这些有害物质？','清水浸泡洗涤','加热烹饪','清洗去皮','纸巾擦试','4','2');
INSERT INTO `aq_subject` VALUES ('527','当洪水来到，来不及转移时应该怎么办？','就近向低处跑','顺河道跑','爬到电线杆或者铁塔上去','爬到屋顶等待救援','4','2');
INSERT INTO `aq_subject` VALUES ('528','下面关于火灾和烧烫伤的知识不正确的是?','青少年中，绝大部分烧烫伤是由于滚烫的液体、水龙头中的热水或是蒸汽造成的','滚烫的开水泼溅到了你的身上，不到一秒钟就会烫伤你的皮肤','30秒不足以使一个小小的火苗演变成重大的火灾','火灾发生后的几分钟，整个房间都会充满浓浓的黑烟','3','2');
INSERT INTO `aq_subject` VALUES ('529','在集体宿舍如何防止纠纷?','只顾自己的生活原则;','互相刁难;','在交往中尔虞我诈;','要相互信任,不要互相猜关系。','4','2');
INSERT INTO `aq_subject` VALUES ('530','哪个不是艾滋病传播的基本途径是什么?','母婴传播','血液传播','性传播','空气传播','4','2');
INSERT INTO `aq_subject` VALUES ('531','食品标签上必须标注的内容是什么？','保质期','生产日期','详细的厂址及企业名称','以上都必须具有','4','2');
INSERT INTO `aq_subject` VALUES ('532','停电时，不该怎么做？','要尽可能用应急照明灯照明','要及时关闭电源开关或拔掉插头','要采用有玻璃罩的油灯','可以用汽油代替煤油或柴油做燃料使用','4','2');
INSERT INTO `aq_subject` VALUES ('533','预防学生宿舍火灾，应怎么做?','在宿舍使用“热得快”等违章电器?????','在宿舍使用酒精炉','躺卧吸烟和乱扔烟头，在宿舍抽烟????','离开宿舍时拔下电源插头','4','2');
INSERT INTO `aq_subject` VALUES ('534','为了自身安全，进入陌生场所应该先了解一些场所设备，下列哪项错误？','避难逃生方向。','安全门、梯位置，及是否未关闭、是否上锁。','查看消防栓、缓降机、救助袋等各项灭火、避难器具位置','有没有熟人','4','2');
INSERT INTO `aq_subject` VALUES ('535','以下学生宿舍防火措施中错误的是','不私拉乱接电源','不使用酒精炉、电饭锅、热得快等可能引发火灾的电热设备。','要人走灯关；','在窗口或阳台燃放烟花爆竹','4','2');
INSERT INTO `aq_subject` VALUES ('536','有人邀请你做不利于学校稳定的事，你该怎么办?','哥们义气要帮忙；','冲动草率处置；','激化矛盾，隐瞒情况；','如发现是少数别有用心的人进行恶意煽动，破坏学校稳定，要敢于与之做斗争。','4','2');
INSERT INTO `aq_subject` VALUES ('537','如何参加灭火时，下列哪项错误？','一切行动听指挥；','要提高警惕，遵守火场秩序，防止坏人破坏，窃取财物。','要注意安全，避免不必要的伤亡。','擅作主张','4','2');
INSERT INTO `aq_subject` VALUES ('538','学生在旅行途中，以下做法错误的是','注意避免购买假票','妥善处理“拉客”行为','正确应对其诈骗手段','借手机给陌生人使用','4','2');
INSERT INTO `aq_subject` VALUES ('539','与老师发生矛盾下列哪项不是正确的处理方式？','树立尊重老师的思想；','要本着尊重老师的思想来认识和处理师生之间的矛盾；','如果与老师或领导的分歧一时难以统一认识，可以求同存异，保留 不同自己的意见。','与老师作对，不配合班级工作','4','2');
INSERT INTO `aq_subject` VALUES ('540','大震发生后的瞬间抉择很重要，能有效地减少伤亡。正确的抉择是','不顾一切冲出屋外','慌不择路逃到窄巷中','越窗跳楼往外逃','震时就近躲避，第一次大震后迅速撤离到安全地带','4','2');
INSERT INTO `aq_subject` VALUES ('541','在大多数情况下，病毒侵入计算机系统以后','病毒程序将立即破坏整个计算机软件系统','计算机系统将立即不能执行我们的各项任务','病毒程序将迅速损坏计算机的键盘、鼠标等操作部件','一般并不立即发作，等到满足某种条件的时候，才会出来活动捣乱、破坏','4','2');
